ới màu sắc thời thượng, xu hướng\r\nThiết kế thu hút ánh nhìn - Gập không kẽ hỡ, dẫn đầu công nghệ bản lề Flex\r\nTuyệt tác selfie thoả sức sáng tạo - Camera sau hỗ trợ AI xử lí cực sắc nét ngay cả trên màn hình ngoài\r\nBền bỉ bất chấp mọi tình huống - Đạt chuẩn kháng bụi và nước IPX8 cùng chất liệu nhôm Armor Aluminum giúp hạn chế cong và xước\r\nSamsung Z Flip 5 có màn chính hình rộng 6.7 inch, với độ phân giải Full HD+ (1080 x 2636 Pixels), cụm camera trước 10MP và camera sau 12MP, rõ đến từng chi tiết. Cấu hình của sản phẩm mạnh mẽ nhờ hệ điều hành Android 10, con chipset mạnh mẽ Snapdragon 8 gen 2, với chip đồ họa tạo hình ảnh hiển thị hàng triệu màu sắc khác nhau. Sản phẩm có RAM 8GB, bộ nhớ trong 512GB.','2024-11-26 12:22:23','2024-11-26 12:22:23',212,'/assets/uploads/products/product-1732623743095-36322002.webp'),(11,1,'OPPO A3 (6GB 128GB)','Đặc điểm nổi bật của OPPO A3 (6GB 128GB)\r\nMàn hình LCD, 6.67 inch cho phép bạn xem nội dung với độ chi tiết cao và màu sắc rực rỡ.\r\nChip Snapdragon 6s 4G Gen 1 mang đến hiệu năng mượt mà, xử lý các tác vụ hàng ngày một cách nhanh chóng.\r\nCamera sau 50MP cho phép bạn chụp ảnh chất lượng cao, với độ chi tiết cao và màu sắc rực rỡ. \r\nPin dung lượng lớn 5100mAh cho phép bạn sử dụng điện thoại cả ngày dài mà không cần lo lắng về việc hết pin.','2024-11-26 12:23:52','2024-11-26 12:23:52',214,'/assets/uploads/products/product-1732623832577-127818438.webp'),(12,1,'OPPO Find X5 Pro 12GB 256GB ','chỉ có tại CellphoneS\r\nChip Snapdragon 8 Gen 1 cho hiệu suất mạnh mẽ, cân mọi tác vụ từ giải trí đến làm việc\r\nMàn hình AMOLED 120 Hz mang đến cho bạn trải nghiệm mượt mà, màu sắc sống động\r\nDùng thoải mái cả ngày với dung lượng pin 5.000 mAh, tích hợp sạc nhanh 80W hiện đại\r\nRAM 12GB đảm bảo khả năng xử lý đa nhiệm không giật lag, ROM 256GB giúp lưu trữ tốt','2024-11-26 12:25:42','2024-11-26 12:25:42',214,'/assets/uploads/products/product-1732623942723-988943676.webp'),(13,1,'OPPO A38 6GB 128GB','Đặc điểm nổi bật của OPPO A38 6GB 128GB\r\nTrải nghiệm hình ảnh rõ ràng, sắc nét với màn hình LCD 6.56 inch HD+ (1612 x 720) cùng tần số quét 90 Hz.\r\nCPU MediaTek Helio P35 8 nhân,  cho khả năng xử lý đa nhiệm mượt mà, chơi game nhẹ và các tác vụ cơ bản.\r\nChụp ảnh đẹp, rõ ràng với camera sau AI 13MP (chính) + 2MP (macro) + 2MP (đơn sắc).\r\nPin dung lượng lớn 5000mAh: Sử dụng thoải mái cả ngày dài với pin dung lượng lớn 5000mAh, hỗ trợ sạc nhanh 33W.','2024-11-26 12:27:15','2024-11-26 12:27:15',214,'/assets/uploads/products/product-1732624035390-289951753.webp'),(14,1,'OPPO Find N3 16GB 512GB','Đặc điểm nổi bật của OPPO Find N3 16GB 512GB\r\nBậc thầy thiết kế, siêu mỏng nhe - Mỏng chỉ 239g, nhẹ chỉ 5.8mm với nếp gấp tàng hình\r\nRực rõ mọi màn hình hiển thị - Kích thước lên đến 7.8mm, độ phân giải 2K+ cùng tần số quét 120Hz mượt mà\r\nBậc thầy nhiếp ảnh - 3 camera hàng đầu đến 64MP kết hợp cùng đa dạng chế độ chụp hoàn hảo\r\nNâng cao hiệu suất sử dụng - Chip MediaTek Dimensity 9200 5G mạnh mẽ cùng hàng loạt tính năng đa nhiệm thông tinh\r\nOPPO Find N3 được chính thức ra mắt ngày 26/10 tại thị trường Việt Nam mang đến nhiều nâng cấp mới mẻ. Trên phiên bản điện thoại gập thế hệ thứ 3 này, OPPO tạo ra một mẫu flagship mạnh mẽ hơn với chip Qualcomm Snapdragon® 8 Gen 2 Mobile Platform, 16GB RAM, màn hình chính 7.82 inch, màn hinh ngoài 6.31 inch cùng hệ thống camera Hasselblad đầy ấn tượng.','2024-11-26 12:29:03','2024-11-26 12:29:03',214,'/assets/uploads/products/product-1732624143755-303812144.webp'),(15,1,'Xiaomi Redmi 14C 4GB 128GB','Đặc điểm nổi bật của Xiaomi Redmi 14C 4GB 128GB\r\nMàn hình 6,88 inch, lớn nhất trên dòng Redmi cho đến nay, mang đến không gian xem rộng rãi và phong phú .\r\nViên pin lớn 5160mAh, giúp người dùng yên tâm duy trì kết nối mà không cần phải sạc lại thường xuyên.\r\nRedmi 14C được trang bị bộ vi xử lý 8 nhân MediaTek Helio G81- Ultra, mang lại hiệu năng mượt mà và hiệu quả.\r\nĐiện thoại được trang bị hệ thống camera kép AI 50MP mạnh mẽ để dễ dàng ghi lại những khoảnh khắc đáng nhớ.','2024-11-26 12:30:27','2024-11-26 12:30:27',213,'/assets/uploads/products/product-1732624227693-958978527.webp'),(16,1,'Xiaomi 14 Ultra 5G (16GB - 512GB)','Đặc điểm nổi bật của Xiaomi 14 Ultra 5G (16GB - 512GB)\r\nTrải nghiệm chụp hình camera Xiaomi 14 Ultra như máy ảnh nhờ 4 camera cao cấp\r\nMãn nhãn với thiết kế thanh lịch cùng các gam màu bắt mắt\r\nGhi điểm mạnh mẽ với màn hình AMOLED đẹp mắt, thẩm mỹ\r\nChip Snapdragon 8 Gen 3 hoạt động mạnh mẽ, pin 5000mAh','2024-11-26 12:32:05','2024-11-26 12:32:05',213,'/assets/uploads/products/product-1732624325263-419401387.webp'),(17,3,'Đồng hồ thông minh Xiaomi Redmi Watch 5 Active','Đặc điểm nổi bật\r\nTrang bị màn hình LCD 2.0 inch, cho phép hiển thị sắc nét và sống động.\r\nĐồng hồ hỗ trợ nhiều chế độ thể thao, giúp người dùng theo dõi hoạt động tập luyện một cách hiệu quả.\r\nThời lượng pin ấn tượng lên đến 18 ngày, giúp người dùng thoải mái sử dụng mà không lo hết pin.\r\nTích hợp tính năng theo dõi sức khỏe, bao gồm đo nhịp tim và giấc ngủ.','2024-11-26 12:34:21','2024-11-26 12:34:21',213,'/assets/uploads/products/product-1732624461074-636244087.webp'),(18,1,'Xiaomi POCO M5 (6GB 128GB)','Đặc điểm nổi bật của Xiaomi POCO M5 (6GB 128GB)\r\nHiệu năng bượt trội - Bộ vi xử lý Helio G99 đầy mạnh mẽ, RAM 6GB giúp máy ổn định chiến game\r\nSắc nét đến từng chi tiết - Màn hình 6.58 inch Full HD+ hỗ trợ 90 Hz mượt mà\r\nKiến tạo những thước phim sống động - Bộ ba camera AI độ phân giải lên đến 50 MP\r\nNăng lượng vượt trội, chiến game cả ngày - Dung lượng 5000 mAh cùng khả năng sạc nhanh 18 W','2024-11-26 12:36:28','2024-11-26 12:36:28',213,'/assets/uploads/products/product-1732624588469-381387908.webp'),(19,1,'vivo Y02t 4GB 64GB + So sánh','Đặc điểm nổi bật của vivo Y02t 4GB 64GB\r\nCông nghệ hiện đại cùng thiết kế cổ điển, tạo nên cụm camera hoàn hảo với vẻ đẹp đơn giản, tinh tế.\r\nTạm biệt nỗi lo pin yếu với dung lượng pin lên đến 5000mAh.\r\nMàn hình tràn viền với độ phân giải HD+ giúp bạn có trải nghiệm thị giác rộng lớn và hình ảnh sắc nét ấn tượng.\r\nThiết kế cong cạnh 2.5D và khung viền phẳng dẫn đầu xu hướng tạo nên chất riêng khác biệt.','2024-11-26 12:38:13','2024-11-26 12:38:13',215,'/assets/uploads/products/product-1732624693259-9395809.webp'),(20,2,'iPad Gen 10 10.9 inch 2022 Wifi 64GB I Chính hãng Apple Việt Nam','Đặc điểm nổi bật\r\nKiểu dáng mỏng nhẹ, phong cách hiện đại - Khung viền và mặt lưng kim loại, mỏng chỉ 7 mm\r\nHiệu năng đỉnh xử lí mọi tác vụ - Apple A14 Bionic với tốc độ tối đa 3.1 GHz, RAM 4 GB\r\nMang đến thế giới hình ảnh sắc nét, sống động - Màn hình Retina IPS LCD kích thước 10.9 inch\r\nĐồng hành cùng bạn trong thời gian dài - Pin lớn trên 7000 mAh, sạc nhanh tối ưu thời gian','2024-11-26 12:39:38','2024-11-26 12:39:38',211,'/assets/uploads/products/product-1732624778475-492664351.webp'),(21,2,'iPad mini 7 2024 Wifi 128GB | Chính hãng Apple Việt Nam','Đặc điểm nổi bật\r\niPad Mini 7 2024 sở hữu thiết kế siêu nhỏ gọn và nhẹ, với màn hình Retina 8.3 inch sắc nét và hỗ trợ True Tone.\r\nĐược trang bị chip A17 Pro mạnh mẽ, iPad Mini 7 đảm bảo hiệu suất ổn định cho mọi tác vụ từ lướt web, xem phim đến chơi game.\r\nDung lượng lưu trữ 128GB cung cấp đủ không gian để lưu trữ các tài liệu, ảnh, video và ứng dụng yêu thích của người dùng.\r\nCamera 12MP ở mặt trước và camera 12MP ở mặt sau giúp chụp ảnh, quay video chất lượng cao phục vụ công việc cũng như chia sẻ trên mạng xã hội.','2024-11-26 12:41:14','2024-11-26 12:41:14',211,'/assets/uploads/products/product-1732624874609-979301873.jpg'),(22,2,'iPad Air 6 M2 11 inch Wifi 128GB | Chính hãng Apple Việt Nam','1TB','2024-11-26 12:42:41','2024-11-26 12:42:41',211,'/assets/uploads/products/product-1732624961376-299561117.webp'),(23,2,'iPad 10.2 2021 WiFi 64GB | Chính hãng Apple Việt Nam','Đặc điểm nổi bật\r\nHiệu năng ổn định - Apple A13 Bionic 6 nhân mạnh mẽ\r\nTrải nghiệm hiển thị chất lượng - Màn hình Retina 10.2 inch, hỗ trợ True Tone\r\nSử dụng thoải mái suốt cả ngày - Pin 32.4 Wh (~8600 mAh) sử dụng lâu dài\r\nGiữ trọn mọi khoảnh khắc - Camera trước 12MP và sau 8MP sắc nét, chuẩn HDR','2024-11-26 12:44:12','2024-11-26 12:44:12',211,'/assets/uploads/products/product-1732625052813-160694196.webp'),(24,3,'Đồng hồ thông minh Huawei Watch GT 5','Đặc điểm nổi bật\r\nSở hữu kiểu dáng khỏe khoắn, phù hợp cho những ai yêu thích phong cách năng động.\r\nDây đeo cao su đen mang lại cảm giác dễ chịu, giúp bạn thoải mái khi đeo trong thời gian dài.\r\nMàn hình AMOLED lớn và sáng giúp hiển thị thông tin rõ ràng, dễ nhìn ngay cả dưới ánh nắng mặt trời.\r\nTích hợp nhiều tính năng theo dõi sức khỏe như nhịp tim, giấc ngủ và mức độ căng thẳng.\r\nHỗ trợ nhiều chế độ thể thao, từ chạy ','2024-11-26 12:46:02','2024-11-26 12:46:02',229,'/assets/uploads/products/product-1732625162877-808190426.png'),(25,3,'Đồng hồ thông minh Huawei Watch D2','Đặc điểm nổi bật\r\nĐồng hồ có thiết kế sang trọng với màn hình AMOLED 1.82 inch, độ phân giải cao và khung viền hợp kim nhôm cứng cáp.\r\nWatch D2 tích hợp các tính năng đo huyết áp và điện tâm đồ (ECG) đạt chuẩn y tế, giúp người dùng theo dõi sức khỏe tim mạch.\r\nThiết bị chạy hệ điều hành HarmonyOS, hỗ trợ nhiều ứng dụng và tính năng thông minh.\r\nPin của đồng hồ có thể sử dụng liên tục trong 6 ngày với một lần sạc đầy.','2024-11-26 12:47:19','2024-11-26 12:47:19',229,'/assets/uploads/products/product-1732625239443-887310030.webp'),(26,3,'Đồng hồ Samsung Galaxy Watch FE 40mm','Đặc điểm nổi bật\r\nTheo dõi sức khỏe toàn diện: Đo thành phần cơ thể, theo dõi giấc ngủ, nhịp tim, phát hiện té ngã.\r\nHuấn luyện viên cá nhân: Theo dõi hơn 100 bài tập, đưa ra phân tích tư thế và tốc độ chạy, cá nhân hóa vùng nhịp tim.\r\nThiết kế bền bỉ: Mặt kính Sapphire chống trầy xước, dây đeo đa dạng, khả năng kháng bụi và nước.\r\nCá nhân hóa: Lựa chọn mặt đồng hồ và dây đeo phù hợp với phong cách của bạn.','2024-11-26 12:48:28','2024-11-26 12:48:28',212,'/assets/uploads/products/product-1732625308814-390181935.webp'),(27,3,'Đồng hồ thông minh Xiaomi Redmi Watch 5 Active','Đặc điểm nổi bật\r\nTrang bị màn hình LCD 2.0 inch, cho phép hiển thị sắc nét và sống động.\r\nĐồng hồ hỗ trợ nhiều chế độ thể thao, giúp người dùng theo dõi hoạt động tập luyện một cách hiệu quả.\r\nThời lượng pin ấn tượng lên đến 18 ngày, giúp người dùng thoải mái sử dụng mà không lo hết pin.\r\nTích hợp tính năng theo dõi sức khỏe, bao gồm đo nhịp tim và giấc ngủ.','2024-11-26 12:50:01','2024-11-26 12:50:01',213,'/assets/uploads/products/product-1732625401412-138393478.webp'),(28,3,'Đồng hồ thông minh Huawei Watch GT 5 Dây Da','Đặc điểm nổi bật\r\nThiết kế đẳng cấp với dây da nâu mang đến vẻ ngoài sang trọng, phù hợp cho cả công việc và các dịp đặc biệt.\r\nMàn hình AMOLED lớn hiển thị sắc nét, giúp bạn dễ dàng theo dõi thông tin và nhận thông báo.\r\nĐồng hồ tích hợp nhiều tính năng theo dõi sức khỏe, bao gồm nhịp tim, giấc ngủ và mức độ căng thẳng.\r\nHỗ trợ nhiều chế độ thể thao, giúp bạn theo dõi và cải thiện hiệu suất tập luyện một cách hiệu quả.\r\nVới thời gian sử dụng lên đến 2 tuần, bạn có thể thoải mái sử dụng mà không phải lo lắng về việc sạc pin thường xuyên.','2024-11-26 12:51:34','2024-11-26 12:51:34',213,'/assets/uploads/products/product-1732625494314-311630971.png'),(29,3,'Vòng đeo tay thông minh Xiaomi Mi Band 8 Pro','Đặc điểm nổi bật\r\nKhung vòng đeo mềm mại và bo cong tỉ mỉ\r\nThiết kế đặc biệt để hỗ trợ việc luyện tập và duy trì sức khỏe\r\nDung lượng pin lên đến 14 ngày cho bạn an tâm sử dụng\r\nTrọng lượng 22.5g giúp đeo tay không hề mỏi\r\nXiaomi Mi Band 8 Pro gây ấn tượng với thiết kế thời trang hiện đại cùng màn hình AMOLED 1.74 inch, hiển thị thông tin sắc nét. Thiết bị cung cấp các tính năng theo dõi sức khỏe toàn diện như nhịp tim, giấc ngủ, căng thẳng và đo SpO2. Hơn 150 chế độ tập luyện: chạy bộ, bơi lội, đạp xe,... giúp người dùng dễ dàng theo dõi và cải thiện sức khỏe. Với pin dung lượng 289mAh, Mi Band 8 Pro có thể hoạt động liên tục đến 14 ngày, cùng tính năng thông minh và giá cả hợp l