ệ Bluetooth 5.3 mang đến kết nối ổn định, mượt mà, tiêu thụ năng lượng thấp, giúp bạn tiết kiệm pin đáng kể.\r\nKhả năng chống nước đạt chuẩn IP54 mang lại cảm giác thoải mái khi sử dụng tai nghe ngoài trời mà không lo bụi bẩn, hoặc mồ hôi.\r\nThời gian sử dụng ấn tượng với dung lượng pin cao, hộp sạc dùng được 30h và tại nghe dùng được 5h\r\nApple AirPods 4 là tai nghe không dây với chip H2 cùng EQ thích ứng và âm thanh không gian cá nhân hóa mang lại trải nghiệm âm thanh ấn tượng. Tai nghe được trang bị Micrô kép với cảm biến quang học cùng micro hướng vào trong giúp thu âm tốt hơn. Cùng với điều khiển chạm cho phép người dùng điều khiển qua các thao tác nhấn tiện lợi.','2024-11-26 16:10:43','2024-11-26 16:10:43',211,'/assets/uploads/products/product-1732637443533-347047022.webp'),(53,7,'Tai nghe Bluetooth True Wireless Baseus Bowie E11','Đặc điểm nổi bật\r\nMàng loa kích thước 12mm cho âm thanh sống động, phù hợp với nhiều nhu cầu nghe\r\nChơi game không lo gián đoạn với khả năng đồng bộ hoá tốt nhờ độ trễ thấp chỉ 0.06s\r\nCông nghệ chống ồn đàm thoại ENC mang đến chất lượng cuộc gọi trong trẻo, rõ ràng\r\nThời lượng sử dụng đến 30 giờ khi dùng kèm hộp sạc, sẵn sàng phục vụ bạn ở mọi nơi\r\nTai nghe Baseus Bowie E11 là tai nghe không dây có cấu trúc bên trong là driver 12mm với khả năng mang đến âm thanh Hi-Fi có sống động và chân thực. Kết hợp với đó là microphone cùng công nghệ chống ồn chủ động ENC giúp bạn có thể thoải mái đàm thoại. Với dung lượng pin đến 400mAh, tai nghe có thể hoạt động liên tục trong 15 giờ. ','2024-11-26 16:12:52','2024-11-26 16:12:52',224,'/assets/uploads/products/product-1732637572189-902923859.webp'),(54,7,'Tai nghe Bluetooth chụp tai Sony WH-1000XM5','Đặc điểm nổi bật\r\nCông nghệ Auto NC Optimizer tự động khử tiếng ồn dựa theo môi trường\r\nTrải nghiệm nghe chân thật, sống động nhờ tính năng 360 Reality Audio\r\nThiết kế sang trọng, trọng lượng nhẹ với phần da mềm mại, ôm khít đầu\r\nNăng lượng cho cả ngày dài với thời lượng sử dụng pin lên đến 40 giờ','2024-11-26 16:14:41','2024-11-26 16:14:41',223,'/assets/uploads/products/product-1732637681233-525952724.webp'),(55,7,'Tai nghe Bluetooth Apple AirPods 3 MagSafe | Chính hãng Apple Việt Nam','Tai nghe Apple AirPods 3 Magsafe - Kiểu dáng thời thượng, chất âm lôi cuốn\r\nMột trong những thế hệ tai nghe không dây được ưa chuộng nhất trên thị trường hiện nay là Apple AirPods 3 Magsafe. Tuy mới chỉ có được ra mắt giữa tháng 10 vừa qua nhưng AirPods 3 của Apple đã nhận được nhiều sự ưa chuộng từ phía người dùng và nhanh chóng trở nên phổ biến trên thị trường thời gian vừa rồi. Với thiết kế gọn nhẹ, bền bỉ cùng chất lượng âm thanh đỉnh cao, AirPods 3 chắc chắn là mẫu tai nghe Apple hoàn hảo mà bạn rất nên sở hữu.','2024-11-26 16:15:56','2024-11-26 16:15:56',211,'/assets/uploads/products/product-1732637756483-166969930.webp'),(56,7,'Tai nghe Bluetooth True Wireless JBL Wave Beam','Đặc điểm nổi bật\r\nCông nghệ JBL Deep Bass Sound và driver 8mm cho chất âm vượt trội\r\nTổng thời lượng nghe lên đến 32 giờ cho trải nghiệm không lo gián đoạn\r\nKháng nước chuẩn IPX2 cho hộp sạc và kháng nước IP54 cho tai nghe\r\nĐiều khiển qua ứng dụng JBL Headphones App giúp bạn thao tác dễ dàng','2024-11-26 16:17:54','2024-11-26 16:17:54',224,'/assets/uploads/products/product-1732637874512-673962832.webp'),(57,7,'Tai nghe Bluetooth True Wireless JBL Tune Flex - Chỉ có tại CellphoneS','Đặc điểm nổi bật\r\nNghe nhạc mọi lúc với thời lượng pin đến 32 (8+24) giờ\r\nChống nước IPX4 không cần ngại mồ hôi, thời tiết xấu\r\nNghe gọi thoải mái và âm thanh chất lượng với 4 micro\r\nKhử ồn chủ động cho bạn thoải mái nghe nhạc bất cứ đâu','2024-11-26 16:19:36','2024-11-26 16:19:36',224,'/assets/uploads/products/product-1732637976232-774190456.webp'),(58,8,'Loa Bluetooth JBL Flip 6','Đặc điểm nổi bật\r\nBass cực mạnh, quẩy cực sung với cụm loa kép cho âm bass sâu trầm\r\nSử dụng thoải mái ở điều kiện môi trường ẩm ướt với kháng nước IP67\r\nTận hưởng âm thanh với tính năng PartyBoost có kết nối 2 loa cùng lúc\r\nViên pin lớn có thể hoạt động lên đến 12 giờ và chỉ mất 2.5 giờ sạc đầy','2024-11-26 16:21:51','2024-11-26 16:21:51',224,'/assets/uploads/products/product-1732638111780-474253783.png'),(59,8,'Loa thanh Soundbar Samsung HW T420','Đặc điểm nổi bật\r\nCông nghệ Smart Sound giúp tối ưu âm thanh tương ứng với từng khung hình hiển thị\r\nChế độ Game Mode giúp loại bỏ âm thanh gây xao nhãng cho trải nghiệm trọn vẹn hơn\r\nCông suất lên đến 150 W cùng âm trầm mạnh mẽ cho chất lượng âm thanh sống động\r\nHỗ trợ kết nối dễ dàng, nhanh chóng với TV Samsung thông qua công nghệ Bluetooth','2024-11-26 16:23:08','2024-11-30 07:42:29',212,'/assets/uploads/products/product-1732952549895-278261298.webp'),(60,9,'Loa tháp Samsung MX-T70','Đặc điểm nổi bật\r\nThưởng thức dải âm trầm mạnh mẽ, chất âm sống động với công suất lên đến 1500W\r\nHiệu ứng ánh sáng rực rỡ từ hệ thống đèn LED DJ cho không khí tiệc tùng tưng bừng\r\nYên tâm sử dụng ngoài trời hoặc hồ bơi, dưới biển với khả năng kháng nước tuyệt đối\r\nTỏa sáng với chế độ karaoke, thoả mái tuỳ chỉnh EQ theo sở thích cùng Sound Tower\r\nLoa tháp Samsung MX-T70 với khả năng tái tạo âm trầm một cách hoàn hảo nhờ loa trầm tích hợp, với công suất lên đến 1500W cho âm thanh thêm sống động. Thiết kế màu đen với 2 mặt loa đa hướng, hiệu ứng đèn LED DJ ấn tượng. Khả năng ghép nối lên đến 10 loa tháp khác nhau, khả năng kháng nước giúp bảo vệ toàn diện loa.','2024-11-26 16:24:00','2024-11-26 16:24:00',212,'/assets/uploads/products/product-1732638240534-597995656.webp'),(61,8,'Loa Bluetooth JBL Go 4','Đặc điểm nổi bật\r\nThưởng thức âm nhạc mà không cần lo lắng về tác động của nước với kháng nước IP67\r\nThời lượng pin đến 7 giờ, cho phép bạn trải nghiệm không cần phải lo ngại về việc hết pin\r\nCông nghệ JBL Auracast, giúp bạn kết nối và chia sẻ âm nhạc từ nhiều nguồn khác nhau\r\nCông suất 4.2W, đảm bảo âm thanh rõ ràng và đủ lớn để nghe nhạc trong không gian nhỏ','2024-11-26 16:25:40','2024-11-26 16:25:40',224,'/assets/uploads/products/product-1732638340286-208748866.png'),(62,9,'Camera DJI Osmo Action 4','Đặc điểm nổi bật\r\nCảm biến 1/1,3 inch cho hình ảnh tuyệt đẹp trong điều kiện ánh sáng yếu\r\nKhả năng chống đống băng, thời lượng sử dụng lên tới 160 phút\r\n10-bit D-Log M cung cấp cho bạn hơn 1 tỷ màu để sử dụng\r\nGóc quay 155 độ siêu rộng, với góc nhìn gần với những gì mắt người nhìn thấy\r\nDJI Mimo giờ đây có thể đồng bộ hóa thông tin hình ảnh từ cảm biến nhiệt độ màu của Action 4 để có các chi tiết rõ nét bên dưới những con sóng.','2024-11-26 16:27:09','2024-11-26 16:27:09',225,'/assets/uploads/products/product-1732638429781-373837585.webp'),(63,9,'Camera IP 360 độ 4MP Ezviz H6C Pro','Đặc điểm nổi bật\r\nEzviz H6c Pro loại bỏ tự động các điểm mù với chế độ tuần tra độc đáo, xoay ngang 340 độ và xoay dọc 55 độ\r\nCó nút gọi trực tiếp trên camera Ezviz H6c Pro có thể đàm thoại 2 chiều, nhận các thông báo quan trọng từ xa\r\nĐem lại hình ảnh rõ nét cả vào ban đêm với ghi màu thông minh lên tới 5 mét và chụp ảnh 10 mét\r\nLưu mọi khoảnh khắc với dung lượng 512GB trên thẻ nhớ MicroSD, xem trực tiếp có thể zoom 8X','2024-11-26 16:28:27','2024-11-26 16:28:27',228,'/assets/uploads/products/product-1732638507404-699884397.webp'),(64,9,'Camera IP 360 độ 4MP Ezviz TY1 Pro','Đặc điểm nổi bật\r\nLưu mọi khoảnh khắc với dung lượng 256GB trên thẻ nhớ MicroSD, xem trực tiếp có thể zoom 8X\r\nEzviz TY1 Pro có thể loại bỏ tự động các điểm mù với chế độ tuần tra độc đáo\r\nCó nút gọi trực tiếp trên camera, có thể đàm thoại 2 chiều, nhận các thông báo quan trọng từ xa\r\nTY1 Pro đem lại hình ảnh rõ nét cả vào ban đêm và chụp ảnh 10 mét','2024-11-26 16:29:57','2024-11-26 16:29:57',228,'/assets/uploads/products/product-1732638597245-756107590.png'),(65,10,'Ốp lưng Samsung Galaxy S22 Ultra Gear4 D3O Milan','Ốp lưng Samsung Galaxy S22 Ultra Gear4 D30 Milan – Cao cấp, bền bỉ\r\nỐp lưng Samsung Galaxy S22 Ultra Gear4 D30 Milan là mẫu ốp lưng được sản xuất chính hãng bởi thương hiệu Gear4 nổi tiếng của Anh, nổi bật bởi thiết kế siêu mỏng nhẹ và thời trang. Điều làm nên sự khác biệt của ốp lưng Samsung Galaxy S22 Ultra này đó là lớp vật liệu chống sốc D3O cho khả năng bảo vệ lên đến 4m.','2024-11-26 16:31:04','2024-11-30 07:42:04',212,'/assets/uploads/products/product-1732952524648-661374291.webp'),(66,10,'Máy chơi game ASUS ROG Ally X','Đặc điểm nổi bật\r\nThiết kế tinh tế với màu đen sang trọng, kích thước nhỏ gọn\r\nBộ xử lý AMD Z1 Extreme mang hiệu suất cao, xử lý mượt mà\r\nLưu trữ dung lượng lớn tới 1TB giúp thoải mái lưu trữ game\r\nCải thiện khả năng cầm nắm nâng cao trải nghiệm chơi game','2024-11-26 16:32:48','2024-11-26 16:33:00',220,'/assets/uploads/products/product-1732638780425-387414524.webp'),(67,10,'Chuột Gaming không dây Logitech G304 Lightspeed','Đặc điểm nổi bật\r\nCảm biến HERO với hiệu suất ổn định và chính xác vượt trội, giúp tăng tốc từ 200 tới 12.000 DPI\r\nCông nghệ LIGHTSPEED giải pháp không dây cấp độ chuyên gia đạt được hiệu suất như có dây\r\nThiết kế cơ học trọng lượng nhẹ chỉ 99g, mang lại cảm giác thoải mái khi sử dụng thời gian dài\r\nNút giữa, DPI và hai nút bên có thể lập trình tùy theo sở thích của bạn bằng G HUB của Logitech','2024-11-26 16:41:41','2024-11-26 16:41:41',265,'/assets/uploads/products/product-1732639301285-546225410.webp'),(68,10,'Tay cầm chơi game không dây Rappo V600S','Tay cầm chơi game không dây Rapoo V600S - Tích hợp rung kép chân thực\r\nTay cầm chơi game không dây Rapoo V600S là sản phẩm có sự cải tiến tốt để mang tới trải nghiệm chơi game, giải trí vui vẻ và dễ dàng thao tác hơn. Tìm hiểu ngay Gaming Gear Pad này qua những thông tin sau.','2024-11-26 16:43:41','2024-11-26 16:43:41',264,'/assets/uploads/products/product-1732639421588-250116785.webp'),(69,7,'Tai nghe chụp tai Gaming Sony Inzone H3','Đặc điểm nổi bật\r\nTrải nghiệm chơi game chân thật và rõ nét nhờ vào công nghệ 360 Spatial Sound\r\nĐệm tai êm ái, ôm khít tai mang lại cảm giác thoải mái khi đeo suốt nhiều giờ liền\r\nTích hợp mic thoại thu âm rõ ràng, tiện lợi - gập xuống để nói, gập lên để tắt tiếng\r\nCấu trúc âm học đối xứng giúp nâng cao chất lượng, độ chính xác của âm thanh','2024-11-26 16:45:55','2024-11-26 16:45:55',223,'/assets/uploads/products/product-1732639554710-106513717.webp'),(70,10,'Chuột Gaming Logitech G502 Hero','Đặc điểm nổi bật\r\nChuột được trang bị cảm biến quang học HERO mang lại hiệu suất ổn định và chính xác vượt trội với khả năng làm mượt, lọc và tăng tốc lên tới 25.600 DPI\r\nHệ thống ứng lực cho nút cơ học cùng với tốc độ phản hồi 1ms nâng cao sự ổn định và giúp giảm lực cần thiết để nhấp chuột nhanh chóng\r\nDây kết nối USB dài 2,1m có trọng lượng nhẹ hơn, mượt mà hơn, linh hoạt hơn và kết nối ổn định\r\nCông nghệ ánh sáng LIGHTSYNC RGB có thể tùy chỉnh hình động và hiệu ứng ánh sáng lên tới 16,8 triệu màu thông qua phần mềm G Hub\r\nTích hợp 11 nút có thể lập trình thông qua phần mềm G Hub của Logitech\r\nTrang bị năm khối nặng có thể điều chỉnh trọng lượng cho cảm giác chuột và hành vi trượt theo sở thích cá nhân\r\nThiết kế thoải mái cho người thuận tay phải với viền bên bằng cao su giúp tăng thêm khả năng điều khiển','2024-11-26 16:47:00','2024-11-26 16:47:00',265,'/assets/uploads/products/product-1732639620828-147653162.webp'),(71,10,'Tai nghe Bluetooth True Wireless Gaming Black Shark T11','Đặc điểm nổi bật\r\nThiết kế độc đáo với nắp trượt, hiệu ứng ánh sáng RGB, tạo ra một không gian chơi game rực rỡ\r\nCông nghệ Bluetooth 5.3, cho kết nối ổn định và tốc độ truyền dữ liệu nhanh, không lo gián đoạn\r\nDriver đến 13mm, mang đến âm thanh mạnh mẽ, độ trễ thấp, giúp giảm hiện tượng trễ âm thanh\r\nThời lượng pin đến 30 giờ, cho phép bạn thưởng thức âm nhạc và chơi game trong thời gian dài\r\nTai nghe Black Shark T11 sở hữu thiết kế độc đáo kết hợp cùng hệ thống đèn RGB bắt mắt cùng thời lượng pin lên đến 30 giờ. Kích thước driver bên trong tai nghe khoảng 13mm với khả năng mang đến chất âm sắc nét, sinh động. Ngoài ra, mẫu tai nghe Black Shark này cũng tích hợp công nghệ kết nối Bluetooth 5.3 và chống ồn chủ động ENC.','2024-11-26 16:48:20','2024-11-26 16:48:20',257,'/assets/uploads/products/product-1732639699975-88696856.png'),(72,11,'Máy chơi game Sony Playstation 5 Bundle Marvel\'s Spiderman 2 Limited Edition','Máy chơi game Sony PlayStation 5 Bundle Marvels Spiderman 2 Limited Edition sở hữu cấu hình đột phá nhờ được trang bị CPU mạnh mẽ. Cùng với đó là kiến trúc đồ hoạ với sức mạnh đáng kinh ngạc, hỗ trợ ray-tracing và xuất hình ảnh game độ phân giải cao. Đặc biệt, thế hệ Play Station này còn bao gồm bộ nhớ trong 825GB, hứa hẹn đem lại trải nghiệm gaming mượt mà, đỉnh cao.','2024-11-26 16:50:25','2024-11-26 16:50:25',223,'/assets/uploads/products/product-1732639824936-710350695.webp'),(73,11,'Kính thực tế ảo Sony Playstation VR2 (CFI-ZVR1 G)','Kính thực tế ảo Sony PlayStation VR2 sở hữu thông số hiển thị cực khủng, lên tới 4K HDR cùng tốc độ làm mới 120Hz siêu mượt mà trên màn hình OLED cao cấp. Kết hợp với đó là tầm nhìn 110 độ và hệ thống âm thanh lôi cuốn qua jack 3.5mm, Sony PSVR 2 sẽ đưa bạn đến với thế giới giải trí chân thực và cực kỳ sống động. Đặc biệt hơn, thiết bị còn sở hữu tính năng Eye Tracking để theo dõi và phản hồi hình ảnh đúng với chuyển động mắt của người dùng. ','2024-11-26 16:51:24','2024-11-26 16:51:24',223,'/assets/uploads/products/product-1732639884469-522761959.png'),(74,11,'Đĩa Game PS5 Spiderman 2 Collector\'s Edition (Vietsub)','Đĩa game PS5 Spiderman 2 Collector\'s Edition có nội dung xoay quanh câu chuyện phiêu lưu trong thế giới độc đáo và đầy thú vị của 2 nhân vật người nhện. Trong game, bạn sẽ hóa thân thành các nhân vật và tự do phiêu lưu, khám phá, chiến đấu với kẻ thù trong thế giới của riêng mình. ','2024-11-26 16:52:27','2024-11-26 16:52:27',223,'/assets/uploads/products/product-1732639947112-891253332.webp'),(75,11,'Đĩa game PS5 Final Fantasy XVI (En Ver) ECAS-00053E','Đặc điểm nổi bật\r\nLà đĩa game PS5 - Final Fantasy XVI - Asia\r\nĐược đề cử là giải The Game cho Game được mong đợi nhất\r\nThuộc thể loại trò chơi nhập vai hành động, trò chơi điện tử đối kháng, trò chơi phiêu lưu\r\nĐược các nhà phát triển SQUARE ENIX CO., LTD., Creative Business Unit III phát hành','2024-11-26 16:53:56','2024-11-26 16:53:56',223,'/assets/uploads/products/product-1732640036989-141837629.webp'),(76,12,'Máy quay chống rung DJI Osmo Pocket 3','ính năng nổi bật\r\n- Sở hữu cảm biến CMOS 1 inch\r\n- Quay video 4K/120fps và Slo-Mo\r\n- Tích hợp chế độ màu D-Log M và HLG 10-bit\r\n- Màn hình xoay 2\" linh hoạt\r\n- Công nghệ ActiveTrack 6.0\r\n- Khả năng lấy nét nhanh toàn điểm ảnh\r\n- Hệ thống chống rung 3 trục\r\n- 3 micro tích hợp, hỗ trợ giảm tiếng ồn của gió \r\n- Thời gian sử dụng lên đến 116 phút ','2024-11-26 16:56:28','2024-11-26 16:56:28',253,'/assets/uploads/products/product-1732640188941-327492187.webp'),(77,14,'USB Wifi siêu nhỏ chuẩn N tốc độ 150Mbps TP-Link TL- WN725N','Đặc điểm nổi bật\r\nTốc độ không dây lên tới 150Mbps trên băng tần 2.4 GHz\r\nKiểu dáng đẹp, thiết kế nhỏ gọn, khi cắm vào có thể để trong cổng USB của laptop\r\nBảo mật nâng cao: Hỗ trợ mã hóa WEP 64/128, WPA, PA2/WPA-PSK/WPA2-PSK(TKIP/AES)','2024-11-26 16:58:08','2024-11-26 16:58:08',269,'/assets/uploads/products/product-1732640288877-462633372.png'),(78,14,'Router Wifi TP-Link Archer C54 băng tần kép AC1200','INSERT INTO brands (name, description, logo_url) VALUES\r\n(\'Cisco\', \'Tập đoàn công nghệ Mỹ hàng đầu thế giới về thiết bị mạng và bảo mật doanh nghiệp\', NULL),\r\n(\'TP-Link\', \'Công ty Trung Quốc chuyên sản xuất thiết bị mạng giá rẻ cho người dùng và doanh nghiệp\', NULL),\r\n(\'NETGEAR\', \'Công ty Mỹ chuyên về thiết bị mạng không dây và giải pháp mạng thông minh\', NULL),\r\n(\'D-Link\', \'Tập đoàn Đài Loan cung cấp giải pháp mạng toàn diện cho gia đình và doanh nghiệp\', NULL),\r\n(\'Ubiquiti\', \'Công ty Mỹ nổi tiếng với thiết bị mạng chuyên nghiệp và giải pháp UniFi\', NULL),\r\n(\'MikroTik\', \'Công ty Latvia chuyên sản xuất thiết bị mạng chuyên nghiệp với giá thành hợp lý\', NULL),\r\n(\'ASUS Networking\', \'Bộ phận thiết bị mạng của ASUS, nổi tiếng với router gaming và mesh wifi\', NULL),\r\n(\'Aruba Networks\', \'Công ty con của HP Enterprise, chuyên về giải pháp mạng doanh nghiệp\', NULL),\r\n(\'Juniper Networks\', \'Tập đoàn Mỹ chuyên cung cấp thiết bị mạng cao cấp và bảo mật\', NULL),\r\n(\'Fortinet\', \'Công ty Mỹ chuyên về bảo mật mạng và thiết bị tường lửa (firewall)\', NULL),\r\n(\'PLANET Technology\', \'Công ty Đài Loan chuyên sản xuất switch công nghiệp và thiết bị mạng\', NULL),\r\n(\'EnGenius\', \'Thương hiệu Đài Loan chuyên về giải pháp wifi outdoor và trong nhà\', NULL),\r\n(\'Grandstream\', \'Công ty Mỹ chuyên về thiết bị VoIP và giải pháp truyền thông doanh nghiệp\', NULL),\r\n(\'Cambium Networks\', \'Công ty Mỹ chuyên về giải pháp mạng không dây cho doanh nghiệp\', NULL),\r\n(\'Ruckus Networks\', \'Thương hiệu của CommScope, chuyên về giải pháp wifi doanh nghiệp cao cấp\', NULL);','2024-11-26 17:00:01','2024-11-28 17:30:26',271,NULL),(79,14,'Bộ phát wifi di động Tenda 4G180 4G LTE AX300 wifi 6','Đặc điểm nổi bật\r\nWi-Fi 6 tốc độ cao: Mang lại trải nghiệm Wi-Fi nhanh hơn, ổn định hơn.\r\nHỗ trợ SIM toàn cầu: Tương thích với hơn 4100 nhà mạng, kết nối dễ dàng mọi nơi.\r\nPin dung lượng lớn 2100mAh: Sử dụng lâu dài, tiết kiệm năng lượng.\r\nQuản lý thông minh: Truy cập trình duyệt \'tendawifi.com\' để xem thông tin và cài đặt.\r\nBộ phát WiFi di động 4G LTE Tenda 4G180 AX300 hỗ trợ công nghệ Wi-Fi 6 với tốc độ truyền nhanh đến 286Mbps với thời lượng pin tối đa 8.5 tiếng đồng hồ. Thêm vào đó, sản phẩm thiết bị mạng Tenda này còn tích hợp cổng USB-C để bạn sạc dễ dàng hơn. Ngoài ra, người dùng có thể quản lý các thông tin qua thiết bị di động mà không cần sử dụng app.','2024-11-26 17:01:14','2024-11-28 16:09:03',273,'/assets/uploads/products/product-1732810143882-383458587.webp'),(80,14,'USB Wifi TP-Link T3U Plus băng tần kép AC1300','Đặc điểm nổi bật\r\nTrang bị băng tần kép: tốc độ 867 Mbps - 5 GHz và 400 Mbps - 2.4 GHz\r\nCông nghệ MU-MIMO cải thiện lưu lượng và hiệu quả của toàn mạng\r\nĂng-ten có thể điều chỉnh, đa hướng giúp bắt sóng và kết nối với Wifi xung quanh\r\nThiết kế nhỏ gọn, tiện lợi, dễ dàng tháo lắp và sử dụng','2024-11-26 17:02:29','2024-11-26 17:02:29',271,'/assets/uploads/products/product-1732640549429-623456889.webp'),(81,14,'Router Wifi 6 Gigibit băng tần kép TP-Link AX3000 Archer AX53','Router Wifi 6 gigabit TP-Link AX3000 Archer AX53 - Băng thông 6g tốc độ nhanh chóng\r\nRouter wifi 6 gigabit băng tần kép TP-Link AX3000 Archer AX53 là một sản phẩm tối ưu và là thiết bị wifi không thể thiếu trong mọi gia đình. Thiết bị này cho khả năng băng thông lên đến 5G với độ phủ sóng rộng và thông lượng lên đến 1201 Mbps nhanh hơn gấp 2 lần so với những Router wifi truyền thố','2024-11-26 17:03:23','2024-11-28 07:50:41',271,'/assets/uploads/products/product-1732780241473-62206240.webp'),(82,13,'Bộ kích sóng WiFi Tenda A9 chuẩn N tốc độ 300Mbps','Thiết bị mở rộng sóng Wi-Fi chuẩn N tốc độ 300Mbps Tenda A9 - Phủ sóng rộng, tín hiệu mạnh\r\nThiết bị mở rộng sóng Wi-Fi chuẩn N tốc độ 300Mbps Tenda A9 được thiết kế để tăng cường vùng phủ sóng rộng hơn với tốc độ ổn định. Thiết bị được sử dụng đơn giản, nên hứa hẹn sẽ là lựa chọn để loại bỏ điểm chết WiFi cho gia đình.','2024-11-26 17:04:27','2024-11-26 17:04:27',270,'/assets/uploads/products/product-1732640667631-766810431.webp'),(83,15,'Thiết bị theo dõi thông minh Samsung Galaxy Smart Tag','Đặc điểm nổi bật\r\nTương thích với các dòng điện thoại Samsung chạy Android 8 trở lên\r\nHiển thị vị trí thiết bị trên google map,điều hướng người dùng đến vị trí thiết bị thông qua GPS\r\nTích hợp loa cho phép phát ra chuông báo giúp dễ dàng tìm được thiết bị ở gần\r\nĐiều khiển các thiết bị thông minh chỉ với 1 thao tác bấm\r\nSử dụng pin CR2032 dễ dàng thay thế,có thể sử dụng liên tục trong khoảng 1 năm','2024-11-26 17:06:12','2024-11-28 17:30:16',212,NULL),(84,15,'Thiết bị phát hiện camera Baseus Heyo Series II','Đặc điểm nổi bật\r\nPhát hiện camera ẩn chính xác: Sử dụng công nghệ hồng ngoại tiên tiến với phạm vi lên đến 10 mét.\r\nCảnh báo nhanh chóng: Âm thanh và đèn LED cảnh báo mạnh mẽ ngay khi phát hiện camera.\r\nDễ sử dụng: Thiết kế nhỏ gọn, đơn giản, chỉ cần bật máy và quét.\r\nBảo vệ riêng tư hiệu quả: Giúp ngăn chặn xâm phạm không mong muốn, bảo vệ sự riêng tư của bạn.\r\nMáy dò camera Baseus Heyo Series II được trang bị công nghệ hồng ngoại thế hệ mới, mang lại khả năng phát hiện camera ẩn. Khi phát hiện camera, máy sẽ phát ra cảnh báo âm thanh mạnh mẽ và đèn LED nhấp nháy, giúp người dùng nhận diện nhanh chóng và phản ứng kịp thời. Đồng thời, thiết kế bên ngoài của máy cũng khá nhỏ gọn, cho phép người dùng có thể dễ dàng cầm theo bên người và kiểm tra, phát hiện camera ẩn trong nhiều môi trường khác nhau.','2024-11-26 17:07:35','2024-11-26 17:07:35',284,'/assets/uploads/products/product-1732640855504-294721296.webp'),(85,13,'Túi chống sốc Tomtoc 360 Protective kèm túi phụ kiện Macbook Pro 14 inch','Túi chống sốc TomToc 360 Protective (kèm phụ kiện) Macbook Pro 14 inch - Bảo vệ toàn diện\r\nTúi chống sốc TomToc 360 Protective (kèm phụ kiện) Macbook Pro 14 inch - món phụ kiện có thiết kế hiện đại, mang lại sự thoải mái và dễ di chuyển cho người. Đồng thời, phụ kiện túi xách Tomtoc còn có khả năng hạn chế hư tổn bên ngoài, bảo vệ chống sốc tăng cường khỏi các trường hợp rơi hay va đập.','2024-11-26 17:09:10','2024-11-28 03:20:12',220,'/assets/uploads/products/product-1732764012338-139238584.webp'),(86,13,'Combo túi chống sốc kèm túi phụ kiện Innostyle Guardiantech Macbook/Laptop 16 inch','Đặc điểm nổi bật\r\nTích hợp công nghệ chống va đập ArmoredEdge độc quyền, viền siêu đàn hồi và lớp đệm mềm mật độ cao\r\nĐược thiết kế với chất liệu vải cao cấp chống tràn, khóa kéo YKK, lớp lót mềm mại họa tiết kim cương tinh tế\r\nNgăn đựng phụ kiện đi kèm với hai túi lưới bên hông, cung cấp giải pháp gọn nhẹ và thời trang để sắp xếp an toàn\r\nQuai cầm thiết kế đặc biệt giúp túi giữ được form dáng gọn gàng, đồng thời giải quyết vấn đề mang theo laptop','2024-11-26 17:10:28','2024-11-26 17:10:28',217,'/assets/uploads/products/product-1732641028084-947107122.webp'),(87,13,'Ốp lưng MagSafe iPhone 16 Pro Max nhựa cứng viền dẻo Bayer II JM ','Ốp lưng MagSafe iPhone 16 Pro Max nhựa cứng viền dẻo Bayer II JM được thiết kế với chất liệu nhựa cứng viền dẻo, mang đến sự kết hợp hoàn hảo giữa tính thẩm mỹ và bảo vệ. Sản phẩm này hứa hẹn sẽ là một lựa chọn đáng cân nhắc cho những ai muốn giữ nguyên vẻ đẹp nguyên bản của chiếc iPhone 16 đồng thời đảm bảo an toàn cho thiết bị.','2024-11-28 17:34:23','2024-11-28 17:34:23',211,'/assets/uploads/products/product-1732815263928-219099701.jpg'),(88,13,'Ốp lưng MagSafe iPhone 16 Plus Nhựa Trong Apple ','1/4\r\nThế Giới Di Động cam kết\r\nchính sách bảo hành\r\nSản phẩm mới, chính hãng (Không bảo hành, đổi trả).\r\n\r\nBài viết đánh giá\r\nỐp lưng MagSafe iPhone 16 Plus Nhựa Trong Apple là một lựa chọn hoàn hảo cho những ai tìm kiếm sự bảo vệ tối ưu mà vẫn giữ được vẻ đẹp nguyên bản của dòng iPhone 16. Với thiết kế mỏng nhẹ, ốp lưng này không chỉ tạo cảm giác cầm nắm thoải mái mà còn giúp bạn dễ dàng thao tác với thiết bị.','2024-11-28 17:35:33','2024-11-28 17:35:33',211,'/assets/uploads/products/product-1732815333414-462396404.jpg'),(89,13,'Ốp lưng Magsafe iPhone 15 Pro Max Vải tinh dệt Apple ','Đặc điểm nổi bật\r\n\r\nThiết kế theo đúng kích cỡ của iPhone 15 Pro Max nên ốp lưng hoàn toàn vừa vặn, bảo vệ tốt.  \r\nMàu sắc thời thượng, các chi tiết được chăm chút kỹ càng cho tính thẩm mỹ cao. \r\nỐp lưng iPhone 15 Pro Max được làm từ chất liệu vải tinh dệt bền bỉ, bề mặt mềm mại, cầm nắm dễ chịu. \r\nNạp pin không dây qua ốp lưng Apple hiệu quả nhờ hỗ trợ sạc MagSafe. \r\nPhím điều khiển dạng nổi cho thao tác bấm chắc chắn, nhạy bén mà không hề có cảm giác đang dùng ốp. \r\nLưu ý: Thanh toán trước khi mở seal.','2024-11-28 17:36:33','2024-11-28 17:36:33',211,'/assets/uploads/products/product-1732815393496-691512346.jpg'),(90,4,'Laptop HP 240 G10 i5 1335U/16GB/512GB/Win11 (9H2E4PT) ','HP 240 G10 - 9H2E4PT là một sản phẩm laptop văn phòng từ hãng HP. Model này được đánh giá cao với các thiết kế hiện đại cùng mức giá rất phù hợp cho các người dùng học sinh, sinh viên hoặc người làm văn phòng. Cùng xem qua các thông số chi tiết của model này néh.\r\n\r\n','2024-11-28 17:40:17','2024-11-28 17:40:17',218,'/assets/uploads/products/product-1732815617082-91594078.jpg'),(91,8,'Loa Bluetooth Xiaomi Sound Pocket ','Loa bluetooth\r\nTổng công suất:\r\n5 W\r\nNguồn:\r\nPin 1000 mAh\r\nThời gian sử dụng:\r\nDùng khoảng 10 tiếng\r\nThời gian sạc:\r\nSạc khoảng 3 tiếng\r\nCông nghệ âm thanh:\r\nTrue Wireless Stereo\r\nPhím điều khiển:\r\nBật/Tắt bluetooth\r\nBật/Tắt nguồn\r\nNhận/Tắt cuộc gọi\r\nPhát/dừng chơi nhạc\r\nTăng/giảm âm lượng\r\nKết nối với nhiều loa\r\nTiện ích:\r\nKết nối nhiều loa\r\nChống nước, chống bụi IP67\r\nCó micro đàm thoại\r\nKết nối\r\nKết nối không dây:\r\nBluetooth 5.4\r\nCổng sạc:\r\nType-C\r\nKhoảng cách kết nối tối đa:\r\n25 m\r\nĐiều khiển bằng điện thoại:\r\nCó','2024-11-28 17:41:47','2024-11-28 17:41:47',213,'/assets/uploads/products/product-1732815707809-388626190.jpg'),(92,8,'Loa Bluetooth JBL Clip 5','Loa JBL Clip 5 sở hữu vẻ ngoài nhỏ gọn cùng tần số 120Hz-20 kHz, thời gian sử dụng lên tới 4-5 tiếng giúp mang lại khả năng phát nhạc hoàn hảo. Không chỉ vậy, sản phẩm cũng sở hữu kết nối bluetooth, jack cắm AUX và thẻ nhớ TF hỗ trợ đa dạng trải nghiệm của người dùng. ','2024-11-28 17:43:40','2024-11-28 17:43:40',224,'/assets/uploads/products/product-1732815820437-418988123.webp'),(93,8,'Loa Bluetooth JBL Go 4','Loa Bluetooth JBL Go 4 sở hữu âm thanh JBL Pro Sound mang lại âm trầm mạnh mẽ cùng viên pin cho thời gian sử dụng lên đến 7 giờ. Cùng với đó sản phẩm loa JBL còn được trang bị chuẩn kháng nước IP67 cùng với đó là thiết kế từ vật liệu tái chế với nhiều màu như đỏ, xanh, trắng, tím, đen. Để nâng cao các trải nghiệm âm thanh, loa còn được trang bị Auracast cho phép ghép đôi 2 loa JBL Go 4, nâng cao trải nghiệm giải trí.','2024-11-28 17:45:07','2024-11-28 17:45:07',224,'/assets/uploads/products/product-1732815907881-456377684.png'),(94,8,'Tai nghe Bluetooth True Wireless JBL Tour Pro 3','Tai nghe JBL Tour Pro 3 đem tới chất lượng âm thanh lôi cuốn hàng đầu với công nghệ JBL Pro Sound cao cấp cùng chống ồn chủ động (ANC) cực xịn. Mẫu tai nghe JBL mới này cũng được cải tiến về mặt thiết kế để có tạo hình nhỏ gọn, dễ đeo và không gây khó chịu khi nghe nhạc giải trí. Ngoài ra, màn hình cảm ứng sắc nét của tai nghe cũng được nâng cấp lên đến 1.57’’, cho phép truy cập nhanh vào các tính năng quan trọng chỉ bằng cách chạm nhẹ.','2024-11-28 17:46:46','2024-11-28 17:46:46',224,'/assets/uploads/products/product-1732816006280-659830775.webp'),(95,8,'Loa Bluetooth LG XBOOM GO XG2','Loa bluetooth LG XBOOM Go XG2 là thiết bị âm thanh di động với chất lượng âm thanh sống động với Sound Boost cho phép tùy chỉnh EQ để cá nhân hóa trải nghiệm nghe. Thiết nhỏ nhắn, dễ lắp đặt mà vẫn đảm bảo độ bền bỉ, đạt chuẩn quân sự của Hoa Kỳ. Đắm chìm trong âm nhạc mọi lúc, mọi nơi mà không lo thấm nước, dính bụi với tiêu chuẩn IP67. ','2024-11-28 17:47:56','2024-11-28 17:47:56',228,'/assets/uploads/products/product-1732816076704-485976413.webp'),(96,8,'Loa Bluetooth Sony SRS-XB100 Extra Bass','Loa Sony SRS-XB100 - Âm thanh sống động\r\nLoa Bluetooth Sony SRS-XB100 với thiết kế nhỏ gọn, năng động cùng với âm bass mạnh mẽ sẽ là một lựa chọn không thể bỏ qua. Với công nghệ hiện đại đặc trưng của hãng, sản phẩm loa Sony này sẽ mang lại cho bạn trải nghiệm âm thanh sôi động và hấp dẫn, cùng với tính di động tiện lợi.','2024-11-28 17:49:27','2024-11-28 17:49:27',228,'/assets/uploads/products/product-1732816167492-612429414.png'),(97,4,'Apple MacBook Air M2 2024 8CPU 8GPU 16GB 256GB I Chính hãng Apple Việt Nam','Apple Macbook Air M2 2022 16GB 256GB thiết kế siêu mỏng 1.13cm, trang bị chip M2 8 nhân GPU, 16 nhân Neural Engine, RAM khủng 16GB, SSD 256GB, màn hình IPS Liquid Retina Display cùng hệ thống 4 loa cho trải nghiệm đỉnh cao.','2024-11-28 17:52:13','2024-11-28 17:52:13',211,'/assets/uploads/products/product-1732816333964-65342061.jpg'),(98,5,'Laptop ASUS TUF Gaming A15 FA506NCR-HN047W','Đặc điểm nổi bật\r\nTrang bị bộ vi xử lý AMD Ryzen 7 7435HS, mang lại hiệu suất cao cho các tác vụ đa nhiệm và gaming.\r\nVới GPU NVIDIA RTX 3050 4GB, laptop có khả năng xử lý đồ họa mượt mà, lý tưởng cho game thủ và thiết kế đồ họa.\r\nMàn hình 15.6 inch Full HD với tần số quét 144Hz giúp hiển thị hình ảnh mượt mà và sống động trong các trò chơi.\r\n16GB RAM cho phép xử lý nhiều ứng dụng cùng lúc mà không gặp khó khăn, tăng cường trải nghiệm người dùng.\r\n512GB PCIe SSD cung cấp không gian lưu trữ rộng rãi và tốc độ truy xuất dữ liệu nhanh, giúp khởi động máy và ứng dụng nhanh chóng.\r\nLaptop Asus TUF Gaming A15 FA506NCR HN047W sử dụng bộ xử lý AMD Ryzen 7 7435HS Mobile Processor 3.1GHz kết hợp card đồ họa NVIDIA GeForce RTX 3050 mạnh mẽ. Sản phẩm sở hữu RAM DDR5 16GB cùng dung lượng ổ cứng SSD 512GB chuẩn kết nối tốc độ cao PCIe cho khả năng đa nhiệm tuyệt vời. Màn hình lớn 15.6 inch FullHD 144Hz chống loá mang tới chất lượng hình ảnh sắc nét và mượt mà trong từng chuyển động. ','2024-11-28 17:54:00','2024-11-28 17:54:00',220,'/assets/uploads/products/product-1732816440679-828887981.webp'),(99,5,'Laptop Acer Aspire 7 A715-76G-5806','Laptop Acer Aspire 7 A715 76G 5806 được trang bị bộ vi xử lý i5 12450H cùng card màn hình rời 4GB RTX3050 và dung lượng RAM 16GB, ổ cứng SSD 512 GB. Máy sở hữu màn hình 15.6 inch FHD với tần số 144Hz. Ngoài ra, sản phẩm laptop Acer Aspire còn nổi bật với thiết kế tối giản, bền bỉ nhờ vỏ nhựa cùng nắp lưng kim loại cứng cáp.','2024-11-28 17:55:46','2024-11-28 17:55:46',221,'/assets/uploads/products/product-1732816546655-716788227.png'),(100,5,'Laptop MSI Gaming Thin 15 B13UC-1411VN','Laptop MSI Gaming Thin 15 B13UC-1411VN sở hữu kích thước 359 x 254 x 21.7 mm và trọng lượng chỉ khoảng 1.86kg, thiết kế tinh giản nhưng vẫn bắt mắt. Laptop có CPU thế hệ 13 – Intel Core i7-13620H, card VGA RTX 3050 từ NVIDIA với công nghệ AI tích hợp. Vận hành êm ái và ổn định nhiệt độ với tản nhiệt Cooler Boost, xử lý nhanh chóng nhờ RAM 8GB, lưu trữ hiệu suất cao với SSD 512GB. Ngoài ra thế hệ laptop MSI Gaming này cũng có màn hình 15.6 inch lớn, tần số 144Hz và chất lượng FHD siêu nét.','2024-11-28 17:57:17','2024-11-28 17:57:17',222,'/assets/uploads/products/product-1732816637748-989465906.webp'),(101,5,'Laptop Lenovo ThinkPad E16 Gen 1 21JN00GJVN','Laptop Lenovo Thinkpad E16 Gen 1 21JN00GJVN sở hữu chipset Intel Core i5-13420H 8 nhân với tốc độ lên tới 4.6GHz, mang lại khả năng xử lý vượt trội. Đi kèm theo đó là thông số bộ nhớ RAM 8GB DDR4-3200, cung cấp trải nghiệm đa nhiệm mượt mà và có thể được mở rộng tối đa đến 40GB. Đồng thời, ổ cứng SSD trên máy cũng sở hữu dung lượng đạt tới 512GB PCIe 4.0x4, giúp truy xuất dữ liệu nhanh chóng và tăng tốc khởi động hệ thống.\r\n\r\n','2024-11-28 17:58:45','2024-11-28 17:58:45',219,'/assets/uploads/products/product-1732816725788-176587272.webp'),(102,13,'Củ sạc Apple 2 cổng Type-C 35W MNWP3ZA-A','Củ sạc nhanh Apple MNWP3ZA-A 35W 2 cổng Type C có thiết kế mới với công suất sạc lên đến 35W. Hãy cùng TSTOREE tìm hiểu rõ hơn về tính năng và điểm nổi bật của củ sạc này nhé!\r\n\r\n','2024-11-28 18:00:44','2024-11-28 18:00:44',211,'/assets/uploads/products/product-1732816844825-805072083.webp'),(103,13,'Củ sạc Samsung Type-C 45W kèm cáp C-C 5A 1.8M T4510','Củ sạc Type C Samsung T4510 45W có kèm cáp là củ sạc được mong đợi nhất trong thời điểm hiện tại. Bởi đây chính là phiên bản sạc dành cho mẫu điện thoại Samsung Galaxy S22 Ultra cực hot gần đây. Hãy xem điểm đặc biệt của củ sạc này là gì nhé!\r\n\r\n','2024-11-28 18:01:48','2024-11-28 18:01:48',212,'/assets/uploads/products/product-1732816908108-119086503.jpg'),(104,15,'Thiết bị phát Wifi di động TP-Link M7350','Bộ phát wifi di động 4G LTE TpLink M7350 thiết kế tiện lợi cho di chuyển cùng tính năng phát wifi vượt trội\r\nViệc sử dụng wifi là nhu cầu gần như thiết yếu của rất nhiều người, từ giải quyết công việc, học tập cho đến giải trí. Wifi sẽ khiến mọi thao tác và tìm kiếm của bạn nhanh hơn. Với bộ phát wifi di động 4G Lte Tplink M7350 bạn có thể thoải mái làm việc ở bất cứ đâu mà không cần phải lo lắng tìm kiếm những nơi có wifi nữa.\r\n\r\nThiết kế nhỏ gọn, chỉ 116g tiện lợi di chuyển cùng màn hình hiển thị tích hợp\r\nBộ phát wifi 4G Lte Tplink M7350 được thiết kế vô cùng nhỏ gọn với trọng lượng chỉ 116g và kích thước 106 x 66 x 16mm với kích thước này thì sản phẩm vô cùng tiện lợi cho người dùng khi mang theo công tác, du lịch hoặc mang theo để giải quyết nhu cầu sử dụng mạng wifi của mình. Với màu đen sang trọng và thiết kế một nút nguồn ở giữa khiến wifi di động 4G M7350 trở nên vô cùng tối giản','2024-11-28 18:06:23','2024-11-28 18:06:23',271,'/assets/uploads/products/product-1732817183132-816457034.webp'),(105,12,'Webcam Logitech Brio 4K Stream Edition','Webcam Logitech Brio 4K Stream Edition tích hợp góc quay rộng 90 độ cùng 2 cài đặt FOV bổ sung (65 độ và 78 độ) giúp bạn tùy chỉnh góc quay linh hoạt. Sản phẩm webcam lấy nét tự động cùng với khả năng thu phóng kỹ thuật số 5 lần chất lượng Full HD. Bên cạnh đó, công nghệ RightLight 3 cùng HDR cho hình ảnh sống động. Mic đa hướng kép tích hợp công nghệ lọc tiếng ồn tiên tiến loại bỏ tiếng ồn xung quanh hiệu quả.\r\n\r\n','2024-11-28 18:07:57','2024-11-28 18:07:57',265,'/assets/uploads/products/product-1732817277684-410841542.webp'),(106,12,'Webcam Logitech Brio Micro 300 FHD 1080P','Webcam tích hợp Micro Logitech Brio 300 FHD 1080p - Hình ảnh sắc nét, quay đa chiều \r\nWebcam tích hợp Micro Logitech Brio 300 FHD 1080p là chiếc camera dành cho máy tính cá nhân, có khả năng quay hình ảnh với độ phân giải cao ở nhiều góc độ. Thiết bị còn được trang bị cổng kết nối USB Type C phổ biến để kết nối nhanh chóng với các thiết bị thông minh khác. Hãy xem đoạn mô tả sau đây để hiểu rõ về dòng webcam này!\r\n\r\nĐảm bảo chất lượng ảnh, thiết kế cá tính thân thiện \r\nMicro Logitech Brio 300 FHD 1080p được tích hợp camera có độ phân giải FHD 1080p, giúp quạy chụp video hình ảnh với độ sắc nét cao. Thiết bị còn có khả năng tự động điều chỉnh ánh sáng để bạn luôn xinh đẹp trong mọi cuộc call video.\r\n\r\nWebcam Logitech Brio Micro 300 FHD 1080P\r\n\r\nWebcam có thiết kế hoàn thiện với chi tiết đốm lạ mắt, kết quả từ vật liệu nhựa tái chế thân thiện với môi trường. Ba màu sắc cá tính tha hồ cho bạn chọn lựa gồm có màu graphite, màu rose và màu off-white.\r\n\r\nMở rộng góc quay, âm thanh chân thật\r\nWebcam tích hợp Micro Logitech Brio 300 có thể xoay 90 độ và xoay ngang tối đa 360 độ. Do đó bạn có thể tùy chỉnh góc quay bất cứ lúc nào để thu được hình ảnh theo ý muốn.\r\n\r\nWebcam Logitech Brio Micro 300 FHD 1080P\r\n\r\nThiết bị còn được trang bị thêm micro giảm tiếng ồn công nghệ mới, giúp thu âm và truyền giọng nói chuẩn xác không lẫn tạp âm. Nhờ vậy bạn có thể thoải mái gọi điện nói chuyện với bất cứ ai hoặc thu âm, đọc truyện với chất lượng âm thanh chân thật nhất.\r\n\r\nSắm ngay Webcam tích hợp Micro Logitech Brio 300 chính hãng tại CellphoneS\r\nWebcam tích hợp Micro Logitech Brio 300 đã có mặt tại cửa hàng CellphoneS, khả năng thu quay hình vượt trội và có giá cực tốt. Kết nối ngay với chúng tôi để sẵn sàng trải nghiệm những tính năng hữu ích từ chiếc webcam này nhé! \r\n\r\n','2024-11-28 18:09:12','2024-11-28 18:09:12',265,'/assets/uploads/products/product-1732817352210-563690085.webp'),(107,10,'Bàn phím cơ Logitech G413 SE TKL Brown Switch White Led','Bàn phím cơ Logitech G413 SE TKL - Thiết kế bền bị, độ nhạy cao\r\nLogitech G413 SE TKL là một sản phẩm bàn phím cơ giá rẻ đang được rất nhiều người dùng quan tâm, săn đón. Để hiểu hơn về sản phẩm bàn phím cơ này, hãy cùng nhau theo dõi ngay bài viết sau đây của CellphoneS nhé!\r\n\r\nChất liệu hợp kim nhôm bền bỉ, chân đế có thể điều chỉnh độ cao\r\nBàn phím cơ Logitech G413 SE TKL được thiết kế kiểu dáng truyền thống full size cùng keycaps được hoàn thiện từ PBT bền bỉ. Vật liệu PBT với khả năng chống mài mòn mang lại một hiệu suất chơi game tối ưu.','2024-11-28 18:10:23','2024-11-28 18:10:23',265,'/assets/uploads/products/product-1732817423710-838550590.webp'),(108,6,'Phần mềm Microsoft Office 365 Family (12 tháng X 6 User)','Phần mềm Microsoft Office 365 Family – Sử dụng office bản quyền trên 5 thiết bị\r\nMicrosoft Office 365 Family là phần mềm Microsoft Office cao cấp hiện nay. Sở hữu tính năng lưu trữ đám mây, bảo mật chuyên nghiệp hơn, gói gọn trong một bộ phần mềmcho trải nghiệm văn phòng trở nên hoàn hảo hơn.\r\n\r\nTối đa 6 người dùng, đa dạng các phần mềm Microsoft\r\nPhần mềm Microsoft Office 365 Family dành cho tối đa 6 người dùng (6 tài khoản), đúng với hậu tố Family của gói phần mềm. Đây là gói thuê bao 365 ngày vì thế bạn không cần phải lo về việc gián đoạn sử dụng giữa chừng trong năm.','2024-11-28 18:11:54','2024-11-28 18:11:54',230,'/assets/uploads/products/product-1732817514124-700753446.webp');
